# This file should contain all the record creation needed to seed the database with its default values.
# The data can then be loaded with the rake db:seed (or created alongside the db with db:setup).
#
# Examples:
#
#   cities = City.create([{ name: 'Chicago' }, { name: 'Copenhagen' }])
#   Mayor.create(name: 'Emanuel', city: cities.first)
def make_admins
  #创建系统管理员
  system_admin = Admin.create!(
      name: "Administrator",
      email: "admin@eyoo.com",
      password: "123456789",
      password_confirmation: "123456789"
    )
  system_admin.add_role(:system_admin)
  #创建平台管理员
  3.times do |n|
    platform_admin = Admin.create!(
      name: "p#{n}",
      email: "p#{n}@eyoo.com",
      password: "123456789",
      password_confirmation: "123456789"
    )
    platform_admin.add_role(:platform_admin)
  end
end

def get_all_admin_id
  admins = Admin.all
  result_array = Array.new
  admins.each do |admin|
             if admin.has_role? :platform_admin
                 result_array << admin.id
             end
  end
end

#创建商家
def make_businesses
  admin_ids = get_all_admin_id
  99.times do |n|
    name = Faker::Name.name
    bussiness = Business.create!(
      email: "b#{n}@eyoo.com",
      name: name,
      password: "123456789",
      password_confirmation: "123456789",
      operating_license: "user.jpg",
      legal_person_name: "lzq",
      legal_person_photo: "avatar#{rand(4)+1}.png",
      business_status: 0,
      admin_id: admin_ids[rand(admin_ids.size)]
    )
  end
end

def make_scenic_and_tickets_type
  tickets_type1 = TicketType.create!(name: "漂流")
  tickets_type2 = TicketType.create!(name: "滑雪")
  tickets_type3 = TicketType.create!(name: "游乐场")
  tickets_type4 = TicketType.create!(name: "温泉")
  tickets_type5 = TicketType.create!(name: "名山胜水")
  tickets_type6 = TicketType.create!(name: "古镇")
  scenic_type1 = ScenicType.create!(name: "国内游")
  scenic_type2 = ScenicType.create!(name: "自助游")
  scenic_type3 = ScenicType.create!(name: "出境游")
  scenic_type4 = ScenicType.create!(name: "游轮")
end

def make_users
  99.times do |n|
    name = Faker::Name.name
    user = User.create!(
      account: "123456#{n}",
      name: name,
      password: "123456789",
      password_confirmation: "123456789",
      phone: "123456789#{n}",
      user_identity: 0
    )
  end
end

# seed 
make_admins
make_businesses
make_users
make_scenic_and_tickets_type

