def get_all_businesses_id
  businesses = Business.all
  result_array = Array.new
  businesses.each do |b|
    result_array << b.id
  end
end

# scenic and ticket seed
def make_scenics_and_tickets
  admin_ids = get_all_admin_id
  business_ids = get_all_businesses_id
  99.times do |n|
    name = Faker::Name.name
    scenic = Scenic.create!(
      name: name,
      picture: "",
      manager_name: "lzq",
      manager_number: "123456789123456789",
      business_id: business_ids[rand(business_ids.size)]
    )
    province_array = BaseRegion.get_provinces
    iterator = rand(province_array.size-1)
    business_id = Business.find(rand(Business.count)+1).id
    province_id = province_array[iterator].id
    province = BaseRegion.find(province_array[iterator].id);
    city_array = BaseRegion.get_city(province.code)
    city_id = ""
    if !city_array.empty? 
      iterator = rand(city_array.size-1)
      city_id = city_array[iterator].id
    end
    ticket = Ticket.create!(
      name: name,
      price: 1,
      scenic_id: scenic.id,
      picture: "default.jpg",
      description: "",
      ticket_type_id: rand(13)+1,
      status: 0,
      admin_id: admin_ids[rand(admin_ids.size)],
      business_id: business_id,
      province: province_id,
      city: city_id
    )
  end
end

make_scenics_and_tickets

# order seed
def make_orders
  990.times do |n|
    business = Business.find(rand(Business.count)+1)
    ticket_array = business.tickets
    while ticket_array.empty?
      business = Business.find(rand(Business.count)+1)
      ticket_array = business.tickets
    end
    iterator = rand(ticket_array.size-1)
    ticket = ticket_array[iterator]
    while ticket.nil?
      ticket = ticket_array[iterator]
    end
    order = Order.create!(
      user_id: rand(99)+1,
      money: 1,
      ticket_id: ticket.id,
      status: 0,
      user_number: 1,
      business_id: business.id
    )
  end
end

make_orders
